// Profiles.js
import React from 'react';
import { Link } from 'react-router-dom';
import './styles.css'; // импортируем CSS

const profilesData = [
  { id: 1, name: 'Alice', age: 25, occupation: 'Engineer', image: 'https://i.pinimg.com/564x/ef/cf/f7/efcff740e3a38c3fd3fbb71106ab20e0.jpg' },
  { id: 2, name: 'Bob', age: 30, occupation: 'Designer', image: 'https://i.pinimg.com/564x/ef/cf/f7/efcff740e3a38c3fd3fbb71106ab20e0.jpg' },
  { id: 3, name: 'Charlie', age: 35, occupation: 'Developer', image: 'https://i.pinimg.com/564x/ef/cf/f7/efcff740e3a38c3fd3fbb71106ab20e0.jpg' },
  { id: 4, name: 'David', age: 40, occupation: 'Artist', image: 'https://i.pinimg.com/564x/ef/cf/f7/efcff740e3a38c3fd3fbb71106ab20e0.jpg' },
  { id: 5, name: 'Eve', age: 45, occupation: 'Musician', image: 'https://i.pinimg.com/564x/ef/cf/f7/efcff740e3a38c3fd3fbb71106ab20e0.jpg' },
];

function Profiles() {
  return (
    <div>
      <h1>Profiles</h1>
      <div className="profile-list">
        {profilesData.map(profile => (
          <div key={profile.id} className="profile-card">
            <img src={profile.image} alt={profile.name} className="profile-image" />
            <h2 className="profile-name">{profile.name}</h2>
            <p className="profile-info">Age: {profile.age}</p>
            <p className="profile-info">Occupation: {profile.occupation}</p>
            <Link to={`/profile/${profile.id}`} className="profile-link">View Profile</Link>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Profiles;
